DROP TABLE IF EXISTS `classes`;


CREATE TABLE `classes` (
  `Pidm` int(11) DEFAULT NULL,
  `Term_Code` int(11) DEFAULT NULL,
  `Subject_Code` text,
  `Subject_Desc` text,
  `Course_Number` int(11) DEFAULT NULL,
  `Banner_ID` int(11) DEFAULT NULL,
  `First_Name` text,
  `Last_Name` text,
  `Middle_Name` text,
  `Begin_Time` int(11) DEFAULT NULL,
  `End_Time` int(11) DEFAULT NULL,
  `Bldg_Code1` text,
  `Bldg_Desc1` text,
  `Room_Code1` int(11) DEFAULT NULL,
  `Monday_Ind1` text,
  `Tuesday_Ind1` text,
  `Wednesday_Ind1` text,
  `Thursday_Ind1` text,
  `Friday_Ind1` text,
  `Saturday_Ind1` text,
  `Sunday_Ind1` text,
  `Section_Max_Enrollment` int(11) DEFAULT NULL,
  `Section_Enrollment` int(11) DEFAULT NULL,
  `Section_Available_Seats` int(11) DEFAULT NULL
);

